import React from 'react';
import './styles/css/reset.css';
import MapButton from './components/selectMap/MapButton';
import gif1 from './styles/assets/guile.gif';
import gif2 from './styles/assets/ken.gif';

import './App.css';
import PlayersSelection from './components/PlayersSelection';

function App() {
  return (
    <div className="App">
      {/* ------------------------------- home ------------------------------------ */}
      <div id="animation">
        <img id="gif1" src={gif1} alt="guile" />
        <div id="button" onClick="">
          <input id="play" type="button" value="PLAY" />
        </div>
        <img id="gif2" src={gif2} alt="ken" />
      </div>
      {/* ------------------------------- home ------------------------------------ */}
      <MapButton />
      <PlayersSelection />
    </div>
  );
}

export default App;
